import React, { Component } from "react";

export default class Movie extends Component {
  render() {
    const { movie } = this.props;
    return (
      <div className="container col-sm-3 list_Movie">
        <div>
          <img src={movie.hinhAnh} alt="" />
          <div className="hoverInfo showHover showingDetail" data-id={2377} data-slug="2377-ban-dao">
            <button ng-if="film.media_id !== null && film.media_id != 0" data-trailer="dgUAoEIeigo" className="playTrailer ng-scope" ng-click="playTrailer($event)" type="button" tabIndex={0}>
              <img src="app/assets/img/icons/play-video.png" />
            </button>
          </div>
        </div>
        <div className="pb-3 pt-2">
            <h4>{movie.tenPhim}</h4>
            <p>{movie.tenPhu}</p>
          </div>
      </div>
    );
  }
}
